import React,{Fragment} from 'react';
import Header from "src/components/Header";
import Footer from "src/components/Footer";
import LoginRegister from "src/components/LoginRegister";
import MobileMenu from "src/components/MobileMenu";
import CallToAction from "src/components/CallToAction";
import BlogDetailsPage from "src/templates/BlogDetails"
import RelatedArticles from 'src/components/Blog/related_articles'
const PageBlog = () => {
    return (
        <Fragment>
            <Header/>
            <BlogDetailsPage sidebar={false}/>
            <RelatedArticles />
            <CallToAction/>
            <Footer/>
            <LoginRegister/>
            <MobileMenu/>
        </Fragment>
    );
};

export default PageBlog;
